// components/FilterCard.jsx
import React from "react";
import { Card, CardContent, Typography } from "@mui/material";

const FilterCard = () => {
  return (
    <Card>
      <CardContent>
        <Typography variant="h5">Filter Configuration</Typography>
        {/* Filter配置内容 */}
      </CardContent>
    </Card>
  );
};

export default FilterCard;
